import React, { Component } from "react";

class List extends Component {
  render() {
    var { task, index } = this.props;
    //console.log(task);
    return (
      <tr className="">
        <td className="">{index}</td>
        <td className="">{task.name}</td>
        <td className="">
          <a class= {task.status === true ? 'ui yellow image label' : 'ui gray image label'}>
            Active
          </a>
        </td>
        <td className="">
          <div className="edit">
            <button className="ui yellow button">Revise</button>
            <button className="ui black button">Delected</button>
          </div>
        </td>
      </tr>
    );
  }
}

export default List;
